    false,nt"url": null,nt"notes": "This digital elevation model (DEM) is a
    part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
    Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
    The DEMs created for this project were developed using the NOAA National Weather
    Service's Weather Forecast Office (WFO) boundaries. Because the WFO boundaries can
    cover large areas, the WFO DEM was divided into smaller DEMs to ensure more manageable
    file sizes. The Tampa (FL) WFO DEM was split into two smaller DEMs. They are divided
    along county lines and are: 1. Tampa (FL) WFO - Citrus, Hernando, Pasco, Pinellas,
    and Hillsborough Counties 2. Tampa (FL) WFO - Manatee, Sarasota, Charlotte, and
    Lee Counties This metadata record describes the DEM for Tampa (FL) WFO - Citrus,
    Hernando, Pasco, Pinellas, and Hillsborough Counties. The DEM includes the best
    available lidar data known to exist at the time of DEM creation for the coastal
    areas of Citrus, Hernando, Pasco, Pinellas, and Hillsborough counties, that met
    project specifications. The DEM is derived from LiDAR datasets collected for the
    Florida Department of Emergency Management (FDEM) and the Southwest Florida Water
    Management District (SWFWMD). LiDAR data for Citrus County was collected in 2007.
    Hernando County LiDAR was also collected in 2007. LiDAR collection for Pasco County
    occured in 2004 and 2008. The FDEM LiDAR data for Pinellas and Hillsborough counties
    were collected in 2007 and 2008. Hydrographic breaklines used in the creation of
    the DEM were obtained from FDEM and SWFWMD. In some cases, the National Wetlands
    Inventory and National Hydrography Dataset were used to supplement breaklines from
    FDEM and SWFWMD. The DEMs are hydro flattened such that water elevations are less
    than or equal to 0 meters. The DEM is referenced vertically to the North American
    Vertical Datum of 1988 (NAVD88) with vertical units of meters and horizontally to
    the North American Datum of 1983 (NAD83). The resolution of the DEM is approximately
    5 meters.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
